"98887":{"id":"98887","name":"Tudo ou nada: Seleçao Brasileira","slug":"tudo-ou-nada-selecao-brasileira","original_title":"Tudo ou nada: Seleçao Brasileira","overview":"A Seleção Brasileira segue uma jornada de fé, fraternidade e trabalho duro para reinventar sua identidade e reconquistar uma base de fãs insatisfeita, enquanto busca vencer a Copa América 2019 em casa. Do vestiário, passando pelos treinamentos até os jogos, acompanhamos com acesso jamais visto os bastidores do time de futebol mais famoso do mundo.","first_air_date":"2020-01-31","episode_run_time":60,"vote_average":7.1,"number_of_seasons":1,"number_of_episodes":5,"created_by":["Daniel Ramirez-Suarez"],"production_companies":[],"genres":["Documentário"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/acGbYCfx0UoyHYthuSpF97gLiZL.jpg","poster_path":"https://image.tmdb.org/t/p/original/7CFK6UI2emPFDZF3y7bbLgyY7zR.jpg","cast":["Marquinhos","Everton Cebolinha","Rogério Langanke Caboclo","Paulo Vinícius Coelho","Fernandinho"],"trailer":"FB1eg4R9AfM","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/v9kY7Mlqp9yjhM1fjl5HID2lEoz.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/v9kY7Mlqp9yjhM1fjl5HID2lEoz.jpg","air_date":"2020-01-31","episode_count":5,"overview":"A Seleção Brasileira segue uma jornada de fé, fraternidade e trabalho duro para reinventar sua identidade e reconquistar uma base de fãs insatisfeita, enquanto busca vencer a Copa América 2019 em casa. Do vestiário, passando pelos treinamentos até os jogos, acompanhamos com acesso jamais visto os bastidores do time de futebol mais famoso do mundo.","vote_average":0,"episodes":{"1":{"name":"A obrigação de ganhar","overview":"Enquanto a imprensa e os fãs duvidam da Seleção Brasileira, os jogadores chegam a Teresópolis para se preparar para a Copa América, mas nem tudo está bem com o atacante Neymar Jr.","air_date":"2020-01-31","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/1n4Bi8mbgtnj0UeBDE4DpyljYqP.jpg","vote_average":0},"2":{"name":"Time que joga junto, reza junto","overview":"Sem o talismã Neymar Jr., a equipe é vaiada após a vitória pouco convincente na abertura da Copa América contra a Bolívia, antes de seguir para a Bahia para o jogo contra a Venezuela.","air_date":"2020-01-31","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/rVAfuMxGFGrlfN3rno6KUySzubM.jpg","vote_average":0},"3":{"name":"Heróis e Vilões","overview":"Uma final de grupos que tem que ser vencida contra o Peru é seguida por um emocionante jogo de quartas-de-final contra o Paraguai, onde o astro Gabriel Jesus ocupa o centro do palco.","air_date":"2020-01-31","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/jNKIFcH7V2EMtZ2JDENVXcHKkhy.jpg","vote_average":0},"4":{"name":"O Clássico","overview":"A equipe de Tite está começando a se equilibrar, mas agora eles devem derrotar seu rival mais antigo que conta com o melhor jogador do mundo para chegar à final da Copa América.","air_date":"2020-01-31","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/8ogNvFJgtM00MazLO1URfSqXySZ.jpg","vote_average":0},"5":{"name":"Corre pro abraço","overview":"O Brasil agora está pronto para a vitória no maior palco de todos, mas os torcedores do país continuam céticos em relação ao grupo de jogadores e se eles têm o necessário para ir até o fim no Maracanã.","air_date":"2020-01-31","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/nIswuBtraGB4ITDOEYIPIHrQahV.jpg","vote_average":0}}}}},
