"126485":{"id":"126485","name":"Em Movimento","slug":"em-movimento","original_title":"무빙","overview":"Nesta série de ação sobrenatural, jovens que escondem superpoderes e seus pais, que vivem com segredos dolorosos do passado, enfrentam grandes perigos juntos.","first_air_date":"2023-08-09","episode_run_time":0,"vote_average":8.433,"number_of_seasons":1,"number_of_episodes":20,"created_by":["Park In-je","강풀"],"production_companies":["Studio & New","Mr. Romance"],"genres":["Mistério","Drama"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/8KtphbDARuisrYYr7DVELnJLRWA.jpg","poster_path":"https://image.tmdb.org/t/p/original/pHvCiSsiIKjFTs115HWjz5O54qQ.jpg","cast":["류승룡","한효주","조인성","차태현","류승범"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/A0TNzLe84uFXF0fqwbPbCYOB2Fk.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/A0TNzLe84uFXF0fqwbPbCYOB2Fk.jpg","air_date":"2023-08-09","episode_count":20,"overview":"Esses três alunos tentam esconder suas habilidades especiais de outras pessoas, enquanto seus pais lutam para protegê-los de serem usados por outras pessoas.","vote_average":8.6,"episodes":{"1":{"name":"Último Ano","overview":"O estudante do ensino médio Bongseok esconde um segredo. No primeiro dia de aula, ele fica feliz ao ver que a garota que conheceu no ônibus foi transferida para a turma dele. Enquanto isso, Frank se disfarça de entregador, e acidentes misteriosos começam a acontecer no centro de Seul.","air_date":"2023-08-09","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/vzmsts2DLrQSeWZS3HA9DFyYVML.jpg","vote_average":8.2},"2":{"name":"Booyang: Apoio Familiar, Levitação","overview":"A Mihyun vira uma mãe superprotetora para defender o segredo do Bongseok. Ela acha que esconde bem, mas fica nervosa com incidentes misteriosos acontecendo nas redes sociais. O Frank busca seres sobrenaturais escondidos seguindo ordens de alguém.","air_date":"2023-08-09","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/e4ilufN512VeAvozhkVmafnL8YI.jpg","vote_average":8.8},"3":{"name":"1+1","overview":"Quanto mais perto Bongseok fica de Huisoo, maior o risco de exposição que ele corre.","air_date":"2023-08-09","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/3SzAw7eXASplla0bIxRsT1Y3i3O.jpg","vote_average":9},"4":{"name":"O Segredo","overview":"O segredo de Bongseok é exposto e Huisoo o leva para casa. Frank procura seu terceiro alvo.","air_date":"2023-08-09","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/vc2ydZmrEEWZc79U6KoI1vDhmkg.jpg","vote_average":8.5},"5":{"name":"Recall","overview":"Huisoo garante a Bongseok que seu segredo está seguro ao revelar seu próprio segredo.","air_date":"2023-08-09","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/8EZov2D9DClbDu78feZZIT3iJdH.jpg","vote_average":9.5},"6":{"name":"Super-Relâmpago","overview":"O passado de Jeon Gyedo é revelado. O NIS descobre informações sobre Frank.","air_date":"2023-08-09","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/cXZ1zIpno8XPAgkBUGSX3hqi8T.jpg","vote_average":8.5},"7":{"name":"O Desconhecido","overview":"Frank relembra seu passado ao eliminar seus alvos. Após a visita de Frank, Mihyun reprime seu filho.","air_date":"2023-08-09","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/fWfIG4n3Bgfaovfm1whBThuwLUa.jpg","vote_average":9.3},"8":{"name":"Agente de Elite","overview":"Em 1994, Mihyun aborda o agente de operações secretas Kim Doosik por ordem de Min Yongjun.","air_date":"2023-08-16","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/eICfp1hJNiZqCTUzelnyRWozaJ2.jpg","vote_average":9.2},"9":{"name":"Humanistas","overview":"Doosik e Mihyun se aproximam, e Doosik sugere que eles enganem Min Yongjun.","air_date":"2023-08-16","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/to9IVB8gTD1XXBovN0W0tyNufWF.jpg","vote_average":9},"10":{"name":"O Monstro","overview":"Um grupo de adolescentes inocentes com habilidades extraordinárias enfrenta alguns dos governos mais poderosos do mundo.","air_date":"2023-08-23","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/uBXfPgFKmTQOVir5pcddoasjAw5.jpg","vote_average":6.5},"11":{"name":"Romântico","overview":"Jihee gradualmente se abre para Juwon.","air_date":"2023-08-23","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/wkQ8ElMbYj1Ycnalk71liaD2e1F.jpg","vote_average":10},"12":{"name":"Parceiros","overview":"Doosik aparece no apartamento de Mihyun com um plano para escapar do vice-diretor Min para sempre.","air_date":"2023-08-30","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/gzjOA57A1eGkKSybM6yJDwJHqtJ.jpg","vote_average":9},"13":{"name":"Jang Juwon","overview":"Depois que a Equipe Negra se dissolve, Juwon recebe uma missão do vice-diretor Min para reviver a equipe.","air_date":"2023-08-30","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/6XQuFG42gdJA8LXHUAmD1aeywfg.jpg","vote_average":8.5},"14":{"name":"O Idiota","overview":"Yunyoung é presa e levada depois de participar de um protesto contra a demolição de barracas de rua em Cheonggyecheon. Jaeman tenta salvar sua esposa com sua força, e Juwon é enviado para subjugá-lo, levando a uma luta monstruosa.","air_date":"2023-09-06","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/vJtRzxiC0JKyD4tV0YtNRjWIrpY.jpg","vote_average":9},"15":{"name":"N.T.D.P.","overview":"Mihyun e Juwon assistem ao vídeo do auditório e vão para a Jeongwon High, enquanto Gyedo descobre Junhwa.","air_date":"2023-09-06","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/jnF2Rf85o0IOgLhpcdx14ZqWomk.jpg","vote_average":8.5},"16":{"name":"O Homem no Meio","overview":"Gye-do é forçado a enfrentar seus poderes quando um assassino é enviado para matar Hee-soo. Mi-hyun, sentindo o perigo, corre para o resgate. Jae-man, vendo isso, luta contra a polícia e revela seus poderes monstruosos. Ju-won é enviado para conter Jae-man, mas logo percebe o bom coração dele e o deixa ir para encontrar seu filho.","air_date":"2023-09-13","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/d67eVq4xDDIfq5zSKEsHdqsBCBl.jpg","vote_average":5.5},"17":{"name":"Despertar","overview":"A Huisoo e o Bongseok chegam ao centro esportivo. Com o Bongseok longe, a Huisoo é atacada pelo Junhwa. Ele usa seus poderes para salvá-la. Enquanto isso, o Juwon e a Mihyun encontram agentes norte-coreanos no colégio.","air_date":"2023-09-13","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/qrgx8dFyazJmPDacd0WUXoHrcyy.jpg","vote_average":9.5},"18":{"name":"Sul e Norte","overview":"A Mihyun pergunta ao Deokyoon pelo Doosik, que está desaparecido. A missão da Coreia do Norte do Doosik é revelada.","air_date":"2023-09-20","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/9jRqwq8DxALfsVZOajp8mskAw8b.jpg","vote_average":9},"19":{"name":"Batalha Final","overview":"A situação parece ter se invertido com a chegada do Jaeman, mas a briga toma um novo rumo com o surgimento do norte-coreano com superpoderes Jaeseok. O Junhwa vai para o Colégio Jeongwon encontrar com os agentes norte-coreanos.","air_date":"2023-09-20","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/368ssUWhGSl5Y4DdETyJdfE8gOZ.jpg","vote_average":8.5},"20":{"name":"Dia da Graduação","overview":"Os pais arriscam a vida para proteger os filhos, e os filhos fazem de tudo para salvar os pais. Será que a guerra que dura gerações terá um fim?","air_date":"2023-09-20","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/scD8LKtFb2AYkPu6aZQgViaenGh.jpg","vote_average":8.5}}}}},
