"112888":{"id":"112888","name":"Beleza Verdadeira","slug":"beleza-verdadeira","original_title":"여신강림","overview":"Im Ju-gyeong (Moon Ga-young), que alcançou a fama de garota bonita depois de dominar a arte da maquiagem no YouTube. Ela se transforma em uma \"deusa\" por causa de suas habilidades de maquiagem, mas prefere morrer a revelar seu rosto despido para alguém. Conta sua história de amor com o único garoto que a viu sem maquiagem, Lee Su-ho (Cha Eun-woo), que é um menino atraente e bonito que parece frio por causa de seu passado sombrio, mas na verdade é muito atencioso. Eles crescem quando se encontram, compartilhando seus segredos e encontrando o amor um com o outro, mas Su-ho pode fazer Ju-gyeong encontrar sua verdadeira beleza?","first_air_date":"2020-12-09","episode_run_time":0,"vote_average":8.289,"number_of_seasons":1,"number_of_episodes":16,"created_by":["Yaongyi"],"production_companies":["Bon Factory","Studio N","Studio Dragon"],"genres":["Comédia","Drama"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/A9OMk9nybfRQUX7ds8rpd4lmdaE.jpg","poster_path":"https://image.tmdb.org/t/p/original/ewI0MbWGfal6DtPTOgMTqruhMq0.jpg","cast":["문가영","Cha Eun-woo","황인엽","박유나","임세미"],"trailer":"aEdhdu7uVCU","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/8IILVTF69AcAkUs30TutNjgJLPR.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/8IILVTF69AcAkUs30TutNjgJLPR.jpg","air_date":"2020-12-09","episode_count":16,"overview":"N/A","vote_average":9.6,"episodes":{"1":{"name":"A Garota de Recados","overview":"O bullying implacável dos colegas faz Im Joo-gyeong tomar uma decisão preocupante. Além disso, problemas financeiros na família fazem com que ela mude de escola.","air_date":"2020-12-09","runtime":77,"still_path":"https://image.tmdb.org/t/p/original/3a9GqnAjzfBlBjiERXxSL5KrprJ.jpg","vote_average":8.333},"2":{"name":"Com ou sem Maquiagem","overview":"Depois de encontrar Lee Su-ho na loja de quadrinhos, Joo-gyeong teme que seu segredo seja exposto. Logo depois, ela reconhece um rosto familiar na escola.","air_date":"2020-12-10","runtime":75,"still_path":"https://image.tmdb.org/t/p/original/scJfGyeBGmdWhIVJtYeaTSWaoUU.jpg","vote_average":0},"3":{"name":"A vingança é um Prato que se Serve Frio","overview":"Com medo de ter sua identidade revelada, Joo-gyeong tenta chegar num acordo com Su-ho. Han Seo-jun exige que Joo-gyeong devolva seu capacete.","air_date":"2020-12-16","runtime":73,"still_path":"https://image.tmdb.org/t/p/original/6VzjESP6ybZjhshwI3Jts5HHPU1.jpg","vote_average":0},"4":{"name":"Ju Kyung Vai a um Encontro às Cegas","overview":"Em meio a rumores de um triângulo amoroso na escola, Joo-gyeong aceita um encontro às cegas. Seo-jun e Joo-gyeong descobrem que suas mães são amigas.","air_date":"2020-12-17","runtime":73,"still_path":"https://image.tmdb.org/t/p/original/kI4xtpjolAAOeFO0x364E440Uh6.jpg","vote_average":0},"5":{"name":"Se Ele Tem Sentimentos por Mim","overview":"Joo-gyeong usa seu talento para maquiagem na hora de ajudar uma garota que sofre bullying. Logo depois, ela fica magoada com o comportamento cruel e inesperado de Su-ho.","air_date":"2020-12-23","runtime":72,"still_path":"https://image.tmdb.org/t/p/original/83XxlOW2TzbweRbrHlhqzga6ruD.jpg","vote_average":10},"6":{"name":"Ju Kyung Enfrenta Valentões","overview":"O pai de Su-ho chega na escola do filho e causa um alvoroço. Joo-gyeong tem um encontro tenso com as meninas que fizeram bullying.","air_date":"2020-12-24","runtime":72,"still_path":"https://image.tmdb.org/t/p/original/17hXG6uMjqpMkJz6RImTCI9xSmO.jpg","vote_average":0},"7":{"name":"Sentimentos Mútuos de Amor","overview":"Uma estrela do beisebol se apaixona por Joo-gyeong e começa a flertar com ela. Joo-gyeong vê Su-ho consolando Kang Su-jin.","air_date":"2021-01-06","runtime":72,"still_path":"https://image.tmdb.org/t/p/original/rXJQZyX1TMkoGzdtGplzXqZClap.jpg","vote_average":0},"8":{"name":"Mal-entendido","overview":"A tentativa de Su-ho de esclarecer a situação com Joo-gyeong sobre a viagem da escola não sai como planejado. Seo-jun continua competindo pela atenção de Joo-gyeong.","air_date":"2021-01-07","runtime":70,"still_path":"https://image.tmdb.org/t/p/original/5gjY4MMpdDXqW5BMk2WdaU9OTP3.jpg","vote_average":0},"9":{"name":"Namorado Secreto","overview":"Joo-gyeong busca um trabalho de meio período. Para evitar drama na escola, ela e Su-ho começam a namorar em segredo.","air_date":"2021-01-13","runtime":76,"still_path":"https://image.tmdb.org/t/p/original/oIw5BC71XLHx9476cFRJatsNyoF.jpg","vote_average":0},"10":{"name":"Entre o Amor e a Amizade","overview":"Su-jin revela para Joo-gyeong o que sente por Su-ho. Joo-gyeong descobre uma coisa importante sobre Seo-jun.","air_date":"2021-01-14","runtime":76,"still_path":"https://image.tmdb.org/t/p/original/b7D9EvIqm6GaK7r55HvvYKvJ6OB.jpg","vote_average":0},"11":{"name":"A verdade Sobre Se Yeon","overview":"Joo-gyeong abre o coração para Su-jin. Depois da internação, Su-ho começa a remediar seu relacionamento com Seo-jun.","air_date":"2021-01-20","runtime":75,"still_path":"https://image.tmdb.org/t/p/original/aQ54ddqYg0KyR7zzqsxWHyBaakj.jpg","vote_average":0},"12":{"name":"Estudante Transferido","overview":"Joo-gyeong entra em pânico depois de ver uma colega da antiga escola. Su-jin admite seus verdadeiros sentimentos para Su-ho.","air_date":"2021-01-21","runtime":74,"still_path":"https://image.tmdb.org/t/p/original/h5WGoprfvqES0yXawXYoNvvF37R.jpg","vote_average":0},"13":{"name":"Somente os Tolos Julgam os Outros","overview":"A vida de Joo-gyeong vira de cabeça para baixo depois que a escola toda fica sabendo do segredo dela. Seo-jun tenta descobrir quem vazou a fofoca.","air_date":"2021-01-27","runtime":80,"still_path":"https://image.tmdb.org/t/p/original/yL1bJfenXoIGsILxmqgfn4Q7iR1.jpg","vote_average":0},"14":{"name":"Viagem ao Mar","overview":"Joo-gyeong volta às aulas sem maquiagem e enfrenta as meninas que fazem bullying com ela. A escola toda descobre quem revelou o segredo de Joo-gyeong.","air_date":"2021-01-28","runtime":81,"still_path":"https://image.tmdb.org/t/p/original/swxXz5sFywkY5Neuoxv351Vms6B.jpg","vote_average":10},"15":{"name":"Encontro Inesperado","overview":"Depois de tirar um tempo para cuidar do pai no exterior, Su-ho dá más notícias a Joo-gyeong. Seo-jun confessa seus verdadeiros sentimentos para Joo-gyeong.","air_date":"2021-02-03","runtime":80,"still_path":"https://image.tmdb.org/t/p/original/6bsxciPIGCVLqAoMJvCe0XZ7dUq.jpg","vote_average":10},"16":{"name":"Final Feliz","overview":"Depois de ficar sabendo da partida de Su-ho, Joo-gyeong vai até o apartamento dele. Depois, ela e Su-jin têm uma conversa franca.","air_date":"2021-02-04","runtime":81,"still_path":"https://image.tmdb.org/t/p/original/36nhKe9zIKeSCZitc3ot0f5fwHR.jpg","vote_average":0}}}}},
